description:
If the past two weeks have shown us anything, it’s that our voices, however small they may feel, do actually make a difference. The world is changing — and the young people who are leading this movement are going to be so crucial in this election too. I cannot stress this enough... if you can register to vote, do it! A few great resources to learn about voting, reforming voter suppression, and actionable steps we can take are below! Follow, read up, and get ready...⠀
